import { Span } from 'app/components/Typography';
import { useEffect, useState } from 'react';
import { TextValidator, ValidatorForm } from 'react-material-ui-form-validator';
import * as React from 'react';
import Stack from '@mui/material/Stack';
import ToggleButton from '@mui/material/ToggleButton';
import ToggleButtonGroup from '@mui/material/ToggleButtonGroup';
// import TextField from '@mui/material/TextField';
import { AdapterDateFns } from '@mui/x-date-pickers/AdapterDateFns';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { TimePicker } from '@mui/x-date-pickers/TimePicker';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
// import { Button, Grid, Icon, styled } from '@mui/material';
import { inputFormElements } from 'app/components/FormElement';
import { makeStyles } from '@material-ui/core/styles';
import { Grid, TextField, Button, Card, CardContent, Typography } from '@material-ui/core';

import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

const useStyles = makeStyles((theme) => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  textField: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1),
    width: 200,
    padding: '10px 5px',
  },
}));

const ProjectAddFrom = () => {
  const classes = useStyles();
  const [state, setState] = useState({ date: new Date() });
  const [datePickerValue, setDatePickerValue] = React.useState(new Date());
  const [timePickerValue, setTimePickerValue] = React.useState(new Date());

  const [fund_source, setFundSource] = React.useState('');

  const handleChange = (event) => {
    setFundSource(event.target.value);
    setState({ ...state, [event.target.name]: event.target.value });
  };

  const handleSubmit = (event) => {
    // console.log("submitted");
    console.log(event);
  };

  const { projectname, date } = state;
  const margin = { margin: '0 5px' };
  return (
    <div>
      <ValidatorForm onSubmit={handleSubmit} onError={() => null}>
        <Grid style={{ padding: '10px 5px 0 5px' }}>
          <Card style={{ maxWidth: 600, margin: '0 auto' }}>
            <CardContent>
              <form>
                <Grid container spacing={1}>
                  {inputFormElements.slice(9, 12).map((input) => (
                    <Grid xs={input.xs} sm={input.sm} item>
                      <TextField {...input} />
                    </Grid>
                  ))}
                </Grid>
                {/* <Typography variant="body2" align="left" gutterBottom>
                  Address :{' '}
                </Typography> */}
                <Grid container spacing={1}>
                  <Grid xs={12} sm={6} item>
                    <TextField
                      id="datetime-local"
                      label="Start Date"
                      type="datetime-local"
                      defaultValue="2017-05-24T10:30"
                      className={classes.textField}
                      InputLabelProps={{
                        shrink: true,
                      }}
                    />
                  </Grid>
                  <Grid xs={12} sm={6} item>
                    <TextField
                      id="datetime-local"
                      label="End Date"
                      type="datetime-local"
                      defaultValue="2017-05-24T10:30"
                      className={classes.textField}
                      InputLabelProps={{
                        shrink: true,
                      }}
                    />
                  </Grid>
                </Grid>
                <Grid container spacing={1}>
                  <Grid xs={12} sm={6} item>
                    <FormControl fullWidth>
                      <InputLabel id="demo-simple-select-label">Project Fund Source</InputLabel>
                      <Select
                        labelId="demo-simple-select-label"
                        id="demo-simple-select"
                        value={fund_source}
                        label="Project Fund Source"
                        onChange={handleChange}
                      >
                        <MenuItem value={30}>Duterte</MenuItem>
                        <MenuItem value={20}>Marcos</MenuItem>
                        <MenuItem value={50}>Warly</MenuItem>
                      </Select>
                    </FormControl>
                  </Grid>
                  <Grid xs={12} sm={6} item>
                    <TextField
                      label="Project Budget"
                      placeholder="Enter project budget"
                      variant="outlined"
                      fullWidth="true"
                      required="true"
                    />
                  </Grid>
                </Grid>
                <Grid container spacing={1}>
                  {inputFormElements.slice(14, 15).map((input) => (
                    <Grid xs={input.xs} sm={input.sm} item>
                      <TextField {...input} />
                    </Grid>
                  ))}
                </Grid>
                <Grid container spacing={1}>
                  <Grid item xs={12} align="right">
                    <Button style={margin} type="reset" variant="outlined" color="primary">
                      Reset
                    </Button>
                    <Button type="submit" variant="contained" color="primary">
                      Submit
                    </Button>
                  </Grid>
                </Grid>
              </form>
            </CardContent>
          </Card>
        </Grid>
      </ValidatorForm>
    </div>
  );
};

export default ProjectAddFrom;
